<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Minecraft Username Entry</title>
    <style>
        * {
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            margin: 0;
            padding: 0;
            overflow: hidden; /* Prevent scrolling if the background is larger */
            animation: backgroundMove 15s infinite alternate; /* Apply the animation */
            background-image: url('IMG.png'); /* Replace with your image path */
            background-size: cover; /* Cover the entire page */
            background-position: center; /* Initial position */
            background-repeat: no-repeat; /* Do not repeat the image */
        }

        @keyframes backgroundMove {
            0% {
                background-position: center;
            }
            50% {
                background-position: 10% 10%;
            }
            100% {
                background-position: center;
            }
        }

        .container {
            max-width: 400px;
            margin: 50px auto;
            padding: 20px;
            background-color: rgba(255, 255, 255, 0.8); /* White background with some transparency */
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.2);
            border-radius: 12px;
            border: 2px solid #4caf50; /* Green border */
        }

        h1 {
            text-align: center;
            color: #4caf50; /* Green color for heading */
            font-family: 'Comic Sans MS', cursive, sans-serif; /* Fun font */
        }

        label {
            display: block;
            margin-bottom: 10px;
            font-weight: bold;
            color: #5d4037; /* Brown color */
        }

        input[type="text"] {
            width: 100%;
            padding: 12px;
            margin-bottom: 20px;
            border: 2px solid #4caf50; /* Green border */
            border-radius: 5px;
            font-size: 16px;
            transition: border-color 0.3s; /* Smooth border transition */
        }

        input[type="text"]:focus {
            border-color: #388e3c; /* Darker green on focus */
            outline: none; /* Remove default outline */
        }

        button {
            width: 100%;
            padding: 12px;
            background-color: #4caf50; /* Green background */
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 18px;
            transition: background-color 0.3s; /* Smooth background transition */
        }

        button:hover {
            background-color: #388e3c; /* Darker green on hover */
        }

        #message {
            text-align: center;
            margin-top: 20px;
            font-size: 16px;
            color: #4caf50; /* Green color */
        }
    </style>
</head>
<body>
    <div class="container">
        <h1>Minecraft Username Entry</h1>
        <form id="usernameForm">
            <label for="firstName">Enter your First Name:</label>
            <input type="text" id="firstName" name="firstName" required>
            <label for="username">Enter your Minecraft Username:</label>
            <input type="text" id="username" name="username" required>
            <button type="submit">Submit</button>
        </form>
        <div id="message"></div>
    </div>
